oad has been performed, a percentage discount will be applied to the order sub total.'=>'Wenn mindestens ein Upload durchgeführt wurde, wird ein prozentualer Rabatt auf die Zwischensumme der Bestellung angewendet.','Percentage'=>'Prozentsatz','This is the percentage discount applied to sub total.'=>'Dies ist der prozentuale Rabatt, der auf die Zwischensumme angewendet wird.','Discount description to show on cart'=>'Rabattbeschreibung, die im Warenkorb angezeigt werden soll','If left black will be used as description the upload field name. Use the <strong>%field_title</strong> placeholder to print the upload field title inside the discount description.'=>'Wenn schwarz gelassen wird als Beschreibung der Upload-Feldname verwendet. Verwenden Sie den Platzhalter <strong>%field_title</strong>, um den Titel des Upload-Felds in der Rabattbeschreibung anzeigen zu lassen.','Discount for %field_title'=>'Rabatt für %field_title','Apply only once'=>'Nur einmal anwenden','Enable this option if you do not want to apply the order sub total discount if another upload field already has.'=>'Aktivieren Sie diese Option, wenn Sie den Zwischensummenrabatt der Bestellung nicht anwenden möchten, wenn dieser bereits in einem anderen Upload-Feld angewandt wurde.','Cart fee/discount'=>'Warenkorbgebühr/-rabatt','For each uploaded file the plugin will compute additional costs according the following options. The extra costs will be added to cart as fee.'=>'Für jede hochgeladene Datei berechnet das Plugin zusätzliche Kosten gemäß den folgenden Optionen. Die zusätzlichen Kosten werden dem Warenkorb als Gebühr hinzugefügt.','Overcharge type'=>'Überladungsart','<strong>NOTE:</strong> <strong>Percentage</strong> option will work with Variations/Variable products, only if: <ol><li><strong>Display the upload field for every product variation</strong> option has been enabled</li></ol>'=>'<strong>HINWEIS:</strong> Die Option <strong>Prozentsatz</strong> funktioniert nur mit Variationen/Variablenprodukten, wenn: <ol><li><strong>Upload-Feld für jede Produktvariation anzeigen</strong> aktiviert wurde</li></ol>','Fixed value'=>'Fester Wert','Percentage of item price'=>'Prozentsatz des Artikelpreises','Value'=>'Wert','This will be the percentage or the fixed value added/subtracted to the original item price. Using <strong>negative</strong> values, the fixed/percentage value will be subtracted to the cart (applying then a <strong>discount</strong>).'=>'Dies ist der Prozentsatz oder der feste Wert, der vom ursprünglichen Artikelpreis hinzugefügt/abgezogen wird. Bei <strong>negativen</strong> Werten wird der feste/prozentuale Wert vom Warenkorb abgezogen (wobei dann ein <strong>Rabatt</strong> angewendet wird).','Fee/Discount description to show on cart'=>'Beschreibung der Gebühr/des Rabatts, die/der im Warenkorb angezeigt wird','If left black will be used as description the upload field name. Use the <strong>%prod_name</strong> placeholder to print the product name and the <strong>%field_title</strong> placeholder to print the upload field title inside the fee description.'=>'Wenn leer gelassen, wird als Beschreibung der Upload-Feldname verwendet. Verwenden Sie den Platzhalter <strong>%prod_name</strong>, um den Produktnamen anzuzeigen, und den Platzhalter <strong>%field_title</strong>, um den Titel des Upload-Felds in der Gebührenbeschreibung anzuzeigen.','Extra costs %field_title for %prod_name'=>'Zusätzliche Kosten %field_title für %prod_name','Note that in case of negative values (discount) due to a WooCommerce bug, the fee will be always taxes included.'=>'Beachten Sie, dass bei negativen Werten (Rabatt) aufgrund eines WooCommerce-Fehlers die Gebühr immer inklusive Steuern enthalten ist.','Apply extra costs/discount considering the item cart quantity'=>'Wenden Sie zusätzliche Kosten/Rabatt unter Berücksichtigung der Artikel-Warenkorbmenge an','Detect <span class="wcuf_pdf_label">PDF</span>'=>'<span class="wcuf_pdf_label">PDF</span> erkennen','The extra costs will be applied to each detected page.'=>'Die zusätzlichen Kosten werden auf jede erkannte Seite angewendet.','Overcharge uploads limit'=>'Upload-Limit überhöht','In case of PDF detection: this will option will be applied to pages and in case di multiple uploads, extra cost pages limit is considered globally per field and not per each pdf.'=>'Bei PDF-Erkennung: Diese Option wird auf Seiten angewendet und bei mehreren Uploads wird das Seitenlimit für zusätzliche Kosten global pro Feld und nicht pro PDF berücksichtigt.','Free items'=>'Kostenlose Artikel','Leave 0 for no free items. This option works only if the <strong>Multiple files upload per single field</strong> option has been enabled. For the first N uploads will not be applied any extra cost (where N is the value specified using the following number field). '=>'Lassen Sie 0 für keine kostenlosen Artikel. Diese Option funktioniert nur, wenn die Option <strong>Upload mehrerer Dateien pro einzelnem Feld</strong> aktiviert wurde. Für die ersten N Uploads fallen keine zusätzlichen Kosten an (wobei N der im folgenden Zahlenfeld angegebene Wert ist).','In case of PDF detection: this will be considered as "free pages number" and in case di multiple uploads, free pages are computed globally per field and not per each pdf.'=>'Bei PDF-Erkennung: Dies wird als "freie Seitenzahl" betrachtet und bei mehreren Uploads werden freie Seiten global pro Feld und nicht pro PDF berechnet.','Fee per second'=>'Gebühr pro Sekunde','These option will apply <strong>only for Video/Audio files</strong>. WCUF will try do detect media file the duration (in seconds) extracting the info from its ID3 data (if any and well encoded). For each detected second the plugin will compute the extra costs according the following options.'=>'Diese Option gilt <strong>nur für Video-/Audiodateien</strong>. WCUF wird versuchen, die Dauer (in Sekunden) der Mediendatei zu erkennen und die Informationen aus ihren ID3-Daten (falls vorhanden und gut codiert) zu extrahieren. Für jede erkannte Sekunde berechnet das Plugin die zusätzlichen Kosten gemäß den folgenden Optionen.','The computed extra cost will be added as Cart fee.'=>'Die berechneten zusätzlichen Kosten werden als Warenkorbgebühr hinzugefügt.','An extra text will be added reporting how much costs a second.'=>'Ein zusätzlicher Text wird hinzugefügt, der angibt, wie viel eine Sekunde kostet.','Cost per second'=>'Kosten pro Sekunde','This is the cost per each detected second.'=>'Dies sind die Kosten pro erkannter Sekunde.','Maximun seconds overcharge limit'=>'Maximales Überladelimit in Sekunden','Free seconds'=>'Kostenlose Sekunden','First N seconds can be free, set the desidered values. Leave 0 for no free seconds.'=>'Die ersten N Sekunden können frei sein, stellen Sie die gewünschten Werte ein. Lassen Sie 0 für keine freien Sekunden.','Product cart price'=>'Preis im Warenkorb','The computed fee will be used as product cart price'=>'Die berechnete Gebühr wird als Warenkorbpreis verwendet','The computed fee will be added to product cart price'=>'Die berechnete Gebühr wird zum Warenkorbpreis hinzugefügt','DropBox account unlinked'=>'DropBox-Konto nicht verknüpft','Invalid image path'=>'Ungültiger Bildpfad','Cannot create thumb'=>'Thumbnail kann nicht erstellt werden','Variation'=>'Variation','To use this you have to disable the standard upload field managment for Product page. Go to the Plugin options page and disable it.'=>'Um dies zu verwenden, müssen Sie die Standard-Upload-Feldverwaltung für die Produktseite deaktivieren. Gehen Sie zur Seite mit den Plugin-Optionen und deaktivieren Sie sie.','To use this you have to disable the standard upload field managment for Cart page. Go to the Plugin options page and disable it.'=>'Um dies zu verwenden, müssen Sie die Standard-Upload-Feldverwaltung für die Warenkorbseite deaktivieren. Gehen Sie zur Seite mit den Plugin-Optionen und deaktivieren Sie sie.','To use this you have to disable the standard upload field managment for Check